import React from 'react'


export default function Footer() {

    var footStyle = {
        background: "violet",
        height: "200px"
    }
    return <div className = "container-fluid" style = {footStyle}>
        <div className = "row">
            <div className = "col-md-6"></div>
        </div>
    </div>
}
